import React from 'react';
import PropTypes from 'prop-types';
import './DataNotFound.scss';
const DataNotFound =(props)=>{
    const { name } = props;
    return (
        <div class="container data-not-found">
            <div class="row">
                <div class="col-11 p-0">
                    <div class="jumbotron bg-transparent text-center m-0 d-flex flex-column justify-content-center">
                        <span className="data-not-found-text">{name && `" No ${name} Found "`}</span>
                    </div>
                </div>
            </div>
        </div>
    )
}

DataNotFound.propTypes = {
   name : PropTypes.string.isRequired
};

export default DataNotFound;
